import React, { useEffect, useState } from "react";
import Grid from "./Grid";

const Content = () =>{
    const [result, setResult] = useState([]);
    useEffect(()=>{
        axios 
         .get("/api")
         .then(res => setResult(res.data))
    },[])
    return (
        <div className="col-10">
           <Grid result={result}/>

        </div>
    )
}

export default Content;
